wysyłki','Flexible Shipping PRO'=>'Flexible Shipping PRO','The best and the most powerful Table Rate shipping plugin for WooCommerce. Define the shipping rules based on numerous conditions and configure even the most complex shipping scenarios with ease.'=>'Najlepsza i najpopularniejsza wtyczka wysyłkowa typu Table Rate dla WooCommerce. Zdefiniuj zasady wysyłki w oparciu o liczne warunki i skonfiguruj nawet najbardziej złożone scenariusze wysyłki.','UPS Live Rates and Access Points PRO'=>'UPS WooCommerce - Stawki live i punkty odbioru','WooCommerce UPS integration packed with many advanced features. Display the dynamically calculated live rates for UPS shipping methods and adjust them to your needs.'=>'Integracja WooCommerce UPS z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki UPS i dostosuj je do swoich potrzeb.','UPS Labels and Tracking'=>'UPS WooCommerce - Etykiety nadawcze i śledzenie przesyłek','Create the shipments, generate the printable UPS shipping labels for the placed orders and track the parcels directly from your WooCommerce store.'=>'Twórz przesyłki i generuj etykiety wysyłkowe UPS w WooCommerce. Drukuj etykiety i śledź przesyłki UPS bezpośrednio ze swojego sklepu.','FedEx WooCommerce Live Rates PRO'=>'FedEx WooCommerce - Stawki Live','Enable the FedEx live rates for international delivery and integrate it with your shop in less than 5 minutes. Save your time and money – let the shipping cost be calculated automatically.'=>'Zintegruj swój sklep z najpopularniejszym kurierem na świecie. Włącz stawki live oraz automatyczne usługi FedEx w WooCommerce i zapomnij o ręcznej konfiguracji cen wysyłki.','Distance Based Shipping Rates'=>'Koszt wysyłki na podstawie odległości','Offer shipping rates based on Distance or Total Travel Time calculated by Google Distance Matrix API and don\'t overpay for shipping.'=>'Uzależnij koszt wysyłki od odległości lub czasu dostawy ze sklepu do klienta.','Flexible Shipping Locations'=>'Flexible Shipping Lokalizacje','Calculate the shipping cost based on location. Define your own custom locations, use the WooCommerce defaults or the ones created by 3rd party plugins.'=>'Twórz reguły wysyłki oparte na lokalizacjach. Różnicuj koszty wysyłki dla grup, pojedynczych krajów lub województw.','Flexible Printing'=>'Drukowanie PrintNode','Automate your shipping process. Print the shipping labels on thermal printers via PrintNode service. Let the labels be printed automatically the same time the order is placed.'=>'Połącz WooCommerce z drukarkami za pomocą PrintNode. Automatycznie drukuj etykiety nadawcze, faktury, zamówienia i etykiety adresowe.','Flexible Shipping Import / Export'=>'Flexible Shipping Import/Export','Use the CSV files to import or export your shipping methods. Edit, update, move or backup the ready configurations and shipping scenarios.'=>'Użyj plików CSV, aby importować lub eksportować swoje metody wysyłki. Edytuj, aktualizuj, przenieś lub utwórz kopię zapasową gotowych konfiguracji i scenariuszy wysyłki.','DHL Express Live Rates PRO'=>'DHL Express Live Rates PRO','WooCommerce DHL Express integration packed with many advanced features. Display the dynamically calculated live rates for DHL Express shipping methods and adjust them to your needs.'=>'Integracja WooCommerce DHL Express z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki DHL Express i dostosuj je do swoich potrzeb.','Multi Vendor Shipping'=>'Multi Vendor Shipping','Define precisely the shipping cost calculation rules for each Vendor / Product Author in your marketplace or multivendor store.'=>'Zdefiniuj dokładnie zasady obliczania kosztów wysyłki dla każdego sprzedawcy / autora produktu w swoim marketplace lub sklepie typu multivendor.','Shipping Packages'=>'Shipping Packages','Split the WooCommerce cart content into multiple packages based on various conditions like shipping class.'=>'Podziel koszyk na kilka paczek do wysyłki w oparciu o liczne warunki, takie jak choćby klasa wysyłkowa produktów w koszyku.','Conditional Shipping Methods'=>'Conditional Shipping Methods','Conditionally display and hide the shipping methods in your WooCommerce store. Define the rules when the specific shipping methods, e.g., live rates should be available to pick and when not to.'=>'Wyświetlaj i ukrywaj warunkowo metody wysyłki w swoim sklepie. Określ w prosty sposób reguły, kiedy konkretne metody wysyłki powinny być dostępne, a kiedy nie.','Delivery Date Picker'=>'Wybór czasu dostawy','Let your customers choose a convenient delivery date for the ordered products and make the shipping cost dependent on the date they choose.'=>'Pozwól klientom wybrać datę dostawy i ustalaj koszt wysyłki dla wybranego przez nich terminu.','USPS Live Rates PRO'=>'USPS Live Rates PRO','Serve your customers the automatically and real-time calculated USPS shipping rates. Add the handling fees, insurance and adjust them to your needs with just a few clicks.'=>'Integracja WooCommerce USPS z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki USPS i dostosuj je do swoich potrzeb.','Shipping Cost on Product Page PRO'=>'Koszt wysyłki na stronie produktu PRO','Let your customers calculate and see the shipping cost on product pages based on the entered shipping destination and cart contents. Decide how and when exactly you want the shipping cost calculator to display.'=>'Pozwól klientom sklepu obliczyć koszt wysyłki bezpośrednio na stronie produktu. Zdecyduj, jak i kiedy dokładnie chcesz, aby kalkulator kosztów wysyłki był wyświetlany.','Flexible Shipping Box Packing'=>'Flexible Shipping Pakowanie do wysyłki','Use the advanced box packing WooCommerce algorithm to fit the ordered products into your shipping boxes the most optimal way. Configure the shipping cost based on the type and number of the used shipping boxes.'=>'Użyj zaawansowanego algorytmu pakowania pudełek WooCommerce, aby dopasować produkty w koszyku do pudełek w optymalny sposób. Skonfiguruj koszt wysyłki na podstawie typu i liczby używanych pudełek.','DPD UK & DPD Local'=>'DPD UK & DPD Local','Ship your DPD orders faster with advanced DPD UK & DPD Local WooCommerce integration. Gather shipping details, download printable shipping labels and track parcels - everything is automated.'=>'Wysyłaj swoje zamówienia DPD szybciej dzięki zaawansowanej integracji DPD UK & DPD Local WooCommerce. Zbierz szczegóły wysyłki, pobierz drukowalne etykiety wysyłkowe i śledź paczki - wszystko jest zautomatyzowane.','All'=>'Wszystkie','Live Rates'=>'Stawki Live','Customizable Rates'=>'Zarządzanie wysyłką','Shipping Labels'=>'Etykiety wysyłkowe','Link on plugin list pageExtensions'=>'Rozszerzenia','Shipping Extensions by'=>'Rozszerzenia wysyłki od','Dive into a system of Octolize ecommerce shipping plugins for WooCommerce. Don’t lose your customers, time and money. Let our plugins secure your sales!'=>'Odkryj pełną ofertę wtyczek wysyłkowych WooCommerce od Octolize. Zarządzaj wysyłką, integruj swój sklep z kurierami i wyświetlaj najdokładniejsze stawki za wysyłkę. ','Filter plugins:'=>'Filtruj wtyczki:','Buy plugin →'=>'Kup wtyczkę →','Blackout Lead Days'=>'Wykluczanie dni realizacji','Blackout Lead Days are used to define days of the week when shop is not processing orders.'=>'Wykluczanie dni realizacji służy do ustalenia dni tygodnia, w których sklep nie realizuje zamówień.','Monday'=>'Poniedziałek','Tuesday'=>'Wtorek','Wednesday'=>'Środa','Thursday'=>'Czwartek','Friday'=>'Piątek','Saturday'=>'Sobota','Sunday'=>'Niedziela','Can\'t convert weight to target unit.'=>'Nie można przeliczyć wagi na jednostkę docelową.','Multicurrency is supported by %1$sFlexible Shipping FedEx PRO →%2$s'=>'Wielowalutowość jest wspierana przez wersję PRO Flexible Shipping FedEx. %1$sDowiedz się więcej →%2$s','The shop\'s currency is other than set on the FedEx account. Preferred currency live rates are supported by %1$sFlexible Shipping FedEx PRO →%2$s'=>'Waluta sklepu jest inna niż waluta dla konta FedEx. Stawki w preferowanej walucie obsługuje wersja PRO Flexible Shipping FedEx. %1$sDowiedz się więcej →%2$s','If you have encountered any issues with calculating or displaying the live rates properly enable the debug mode to be able to analyse the FedEx API requests and responses and to find out what\'s causing the problem. %1$sLearn more about the debug mode →%2$s'=>'Jeżeli wystąpiły problemy z prawidłowym obliczaniem lub wyświetlaniem w sklepie stawek rzeczywistych FedEx aktywuj tryb debugowania, aby móc prześledzić wysyłane do API FedEx dane. %1$sSprawdź jak działa tryb debugowania →%2$s','Services %1$s are available only for UK domestic shipments.'=>'Usługi %1$s są dostępne wyłącznie dla krajowych przesyłek w Wielkiej Brytanii.','FedEx'=>'FedEx','These are a general settings of Flexible Shipping FedEx plugin. To learn more about configuration go to the %1$sinstruction manual →%2$s'=>'To są ogólne ustawienia wtyczki Flexible Shipping for FedEx. Aby dowiedzieć się więcej o konfiguracji przejdź do %1$sdokumentacji wtyczki →%2$s','Credentials'=>'Ustawienia API','You need to provide FedEx account credentials to get live rates. Check out our tutorial on %1$show to obtain FedEx credentials →%2$s'=>'Musisz podać dane uwierzytelniające konto FedEx, aby uzyskać stawki rzeczywiste. Sprawdź nasz przewodnik %1$sJak uzyskać dane uwierzytelniające FedEx →%2$s','FedEx Account Number '=>'FedEx Account Number ','FedEx Meter Number'=>'FedEx Meter Number','FedEx Web Services Key'=>'FedEx Web Services Key','FedEx Web Services Password '=>'FedEx Web Services Password ','Test Credentials'=>'Dane testowe','Enable to use test credentials'=>'Włącz aby używać danych testowych','Method Settings'=>'Ustawienia metody','Set how FedEx services are displayed.'=>'Ustaw jak serwisy FedEx będą wyświetlane.','Method Enable'=>'Włączanie metody','Enable FedEx global shipping method'=>'Włącz globalną metodę wysyłki FedEx','If you need to turn off FedEx rates display in the shop, just uncheck this option.'=>'Jeśli chcesz wyłączyć wyświetlanie stawek FedEx w sklepie, odznacz tę opcję.','Gain even more flexibility and add the FedEx Live Rates within specific shipping zones instead of using the Global shipping method. %1$sUpgrade your FedEx WooCommerce Live Rates plugin to PRO now →%2$s'=>'Dopasuj wysyłkę do swoich potrzeb i zamiast Globalnej metody wysyłki dodawaj stawki live FedEx bezpośrednio w określonych strefach wysyłkowych. %1$sRozszerz wtyczkę FedEx WooCommerce Live Rates do wersji PRO →%2$s','Method Title'=>'Tytuł metody wysyłki','This controls the title which the user sees during checkout when fallback is used.'=>'Tytuł metody zostanie wyświetlony klientowi pdoczas składania zamówienia jeśli zostanie zastosowana stawka awaryjna.','Custom Services'=>'Usługi FedEx','Enable custom services'=>'Włącz własne ustawienia usług','Enable if you want to select available services. By enabling a service, it does not guarantee that it will be offered, as the plugin will only offer the available rates based on the package weight, the origin and the destination.'=>'Włącz jeśli chcesz wybrać dostępne usługi. Wybranie usługi nie oznacza, że będzie ona oferowana klientom. Wtyczka wyświetli tylko dostępne usługi na podstawie wagi paczki, adresu nadania i odbioru.','Services Table'=>'Tabela usług FedEx','Rates Adjustments'=>'Dopasowanie stawek','Adjust these settings to get more accurate rates.'=>'Dostosuj poniższe ustawienia, aby otrzymać lepiej dopasowane stawki.','Insurance'=>'Ubezpieczenie','Request insurance to be included in FedEx rates'=>'Przesyłaj opcję ubezpieczenia','Enable if you want to include insurance in FedEx rates when it is available.'=>'Włącz opcję jeśli chcesz uwzględniać ubezpieczenie w stawkach FedEx, gdy jest dostępne.','Rate Type'=>'Typ stawki','All possible rates'=>'Wszystkie stawki','List rates'=>'Standardowe','Account rates'=>'Negocjowane','List rates are set by default. In order to obtain the account rates on your FedEx account please contact FedEx support at fedex.com.'=>'Standardowe stawki są domyślnymi stawkami. W celu uzyskania negocjowanych stawek na swoim koncie FedEx, skontaktuj się z obsługą klienta na fedex.com.','Destination Address Type'=>'Typ adresu dostawy','Destination Type to use with this method.'=>'Typ adresu dostawy do zastosowania z tą metodą.','Business'=>'Biznesowy','Residential'=>'Domowy','Advanced Options'=>'Opcje zaawansowane','Debug Mode'=>'Tryb debugowania','Enable debug mode'=>'Włącz tryb debugowania','Measurement Units'=>'Jednostki miary','LBS/IN'=>'LBS/IN','KG/CM'=>'KG/CM','By default store settings are used. If you see "This measurement system is not valid for the selected country" errors, switch units. Units in the store settings will be converted to units required by FedEx.'=>'Domyślnie pobierane są ustawienia sklepu. Zmień typ jednostek miary jeśli zobaczysz komunikat „This measurement system is not valid for the selected country”. Jednostki ustawione w sklepie zostaną przekonwertowane na jednostki miary wymagane przez FedEx.','Dynamically calculated FedEx live rates based on the established FedEx API connection. %1$sLearn more →%2$s'=>'Dynamicznie obliczane w oparciu o połączenie z API FedEx stawki rzeczywiste. %1$sDowiedz się więcej →%2$s','The maximum package weight has been exceeded. Maximum package weight is: %1$s %2$s.'=>'Maksymalna waga paczki została przekroczona. Maksymalna waga paczki to: %1$s %2$s.','Disabled'=>'Wyłączono','Emergency'=>'Wypadek','Alert'=>'Ostrzeżenie','Critical'=>'Błąd krytyczny','Error'=>'Błąd','Warning'=>'Ostrzeżenie','Notice'=>'Powiadomienie','Info'=>'Informacja','Debug'=>'Debugowanie','Can not enable WP Desk Debug log! Cannot create directory %s or this directory is not writeable!'=>'Nie można włączyć WP Desk Debug log! Nie można utworzyć katalogu %s lub brak uprawnień do zapisu w tym katalogu!','Can not enable WP Desk Debug log! Cannot create file %s!'=>'Nie można włączyć logowania błędów za pomocą WP Desk Debug! Nie można utworzyć pliku %s!','%1$sPlease add now the %2$s shipping method within the shipping zone you want it to be available in →%3$s'=>'%1$sDodaj teraz metodę wysyłki %2$s w strefie wysyłkowej, w której chcesz, aby była dostępna →%3$s','API Connection Status'=>'Status połączenia z API','Checking...'=>'Sprawdzanie...','If you encounter any problems with establishing the API connection, the detailed information on its cause will be displayed here.'=>'Jeśli wystąpią problemy z nawiązaniem połączenia z API, w tym miejscu zostaną wyświetlone szczegółowe informacje o ich przyczynie.','OK'=>'OK','Not found HTML view for custom field %1$s.'=>'Nie znaleziono widoku HTML dla pola niestandardowego %1$s.','None'=>'Brak','Fixed value'=>'Wartość stała','Percentage'=>'Wartość procentowa','Use this option to apply the handling fees to the rates. You can use either fixed or percentage values, including the negative ones for discounts.'=>'Użyj tej opcji by doliczyć stały lub procentowy koszt prowizji do zwracanych przez wtyczkę stawek, włącznie z minusowymi wartościami dla obniżek.','Fees Amount'=>'Wartość prowizji','Enter a positive value to charge your customers additionally or a negative one to apply the discount. If you use the currency switcher, the final price incl. Handling Fee will be automatically converted to the currently active currency in your shop. The rates will also include the taxes based on your current Tax settings.'=>'Dodatnia liczba = dopłata, liczba ujemna = zniżka. Jeżeli używasz switcherów walut, cena końcowa zawierająca prowizję zostanie automatycznie przeliczona na obecnie aktywną walutę w sklepie. W cenie zostaną również uwzględnione aktualne ustawienia podatków.','Code'=>'Kod','Name'=>'Nazwa','Enabled'=>'Włączone','Drag and drop the services to control their display order. Confirm by clicking Save changes button below.'=>'Przeciągnij i upuść usługę, aby zmienić kolejność wyświetlania. Zatwierdź zmiany klika